import React from 'react';
import axios from 'axios';

var data = [];

function httpcall(){
  axios.get("http://localhost:8080/todo").then(function(res){
    console.log(res.data.errors);
    return res.data.data;
  });
}

function App() {
  console.log(data);
  return (
    <div className="App">
      <h1>Hello</h1>
    </div>
  );
}

export default App;
